import React from 'react';
import HeroSection from '../../components/HeroSection';
import PageLayout from '../../components/PageLayout';
import NumerologyData from '../../data/NumerologyData';

const NumerologyCard = ({ data }) => (
  <div className="info-card">
    <h2>Number: {data.number}</h2>
    <p><strong>Meaning:</strong> {data.meaning}</p>
    <p><strong>Element:</strong> {data.element}</p>
    <p><strong>Vibration:</strong> {data.vibration}</p>
    <p><strong>Governs:</strong> {data.governs}</p>
  </div>
);

const Numerology = () => {
  return (
    <PageLayout>
      <HeroSection 
        title="Numerology" 
        subtitle="The vibrational intelligence of numbers." 
        background="/images/numerology-bg.jpg" 
      />
      <div className="info-page-container">
        {NumerologyData.map((item, index) => (
          <NumerologyCard key={index} data={item} />
        ))}
      </div>
    </PageLayout>
  );
};

export default Numerology;
